// Global Definitions
var fav_icon2 = "data:image/x-icon;base64,";
var fav_icon1 = "data:image/png;base64,";
var fav_icon = "data:image/png;base64,"
var submit_start;

var favicon = {

	// Change the Page Icon and Title.
	change: function(iconURL) {
		this.addLink(iconURL, "icon");
		this.addLink(iconURL, "shortcut icon");
	},

	addLink: function(iconURL, relValue) {
		var link = document.createElement("link");
		link.type = "image/x-icon";
		link.rel = relValue;
		link.href = iconURL;
		this.removeLink(relValue);
		this.docHead.appendChild(link);
	},

	removeLink: function(relValue) {
		var links = this.docHead.getElementsByTagName("link");
		for (var i = 0; i < links.length; i++) {
			var link = links[i];
			if (link.type == "image/x-icon" && link.rel == relValue) {
				this.docHead.removeChild(link);
				return; // Assuming only one match at most.
			}
		}
	},
	
	swapLink: function() {
		if (this.run == true) {
			if (this.icon == 1) {
				this.change(fav_icon2);
				this.icon = 2;
			} else {
				this.change(fav_icon1);
				this.icon = 1;
			}
		}
	},
	
	auto_swap: function() {
		if (this.run == true) {
			this.swapLink();
			setTimeout(() => {  this.auto_swap(); }, 1000);
		}
	},
	
	start_swap: function() {
		this.run = true;
		this.auto_swap();
		submit_start = Date.now();
	},
	
	stop_swap: function() {
		this.run = false;
		this.change(fav_icon);
		if (typeof submit_start !== 'undefined') {
			if (document.getElementById("runtime")) {
				$("#runtime")[0].innerHTML = `Execution time: ${Math.round((Date.now() - submit_start)/1000)} sec`;
			}
			delete submit_start;
		}
	},
	
	docHead:document.getElementsByTagName("head")[0]
}